import styled from 'styled-components'

const tasks = [
    {
        text: 'Hello',
    },
    {
        text: 'Hi',
    }
]

const Task = () => {
    return (
        <Container>
            {tasks.map((t) => (
            <h3 > {tasks.text}</h3>
            ))}

        </Container>
    )
}

export default Task

const Container = styled.div`
    width: 100%;
    height: 60px;       
    display: flex;
    background-color: #ECEBBD;
    margin-bottom: 5px;
`
